jQuery("#world-map").mousemove(function(e)
{
    var thisOffset = jQuery(this).offset();      
    var relX = e.pageX - thisOffset.left;
    var relY = e.pageY - thisOffset.top;
    
    
    if (africahover)
    {
      showPanel("africa", relX, relY);      
    }
    if (!africahover)
    {
      hidePanel("africa");
    }
    
    if (europehover)
    {
      showPanel("europe", relX, relY);      
    }
    if (!europehover)
    {
      hidePanel("europe");
    }   
    
    if (australiahover)
    {
      showPanel("australia", relX, relY);      
    }
    if (!australiahover)
    {
      hidePanel("australia");
    }   
    
    if (north_americahover)
    {
      showPanel("north_america", relX, relY);      
    }
    if (!north_americahover)
    {
      hidePanel("north_america");
    }   
    
    if (south_americahover)
    {
      showPanel("south_america", relX, relY);      
    }
    if (!south_americahover)
    {
      hidePanel("south_america");
    }   
    
    if (asiahover)
    {
      showPanel("asia", relX, relY);      
    }
    if (!asiahover)
    {
      hidePanel("asia");
    }   
    
    
});

function showPanel(continent, relX, relY)
{
	if(continent == "north_america" || continent == "south_america")
	{
		jQuery("#"+continent+"-panel").css("left", relX+40).css("top", relY-74); 
	}
	else
	{
		jQuery("#"+continent+"-panel").css("left", relX-400).css("top", relY-74); 
	}
         
    jQuery("#"+continent+"-panel").show();
}

function hidePanel(continent)
{
	jQuery("#"+continent+"-panel").hide();
}


